import React from "react";

import styles from "./bigCard.module.css";

import BigCardContainer from "./bigCardContainer";

const BigCard = ({ imageUrl }) => (
  <div>
    {/* <BigCardContainer imageUrl={imageUrl} /> */}
    <div className={styles.bigCard} style={{ background: `url(${imageUrl})` }}>
      <h1 className={styles.lastMovieText}>LATEST MOVIE</h1>
      <h2 className={styles.movieName}>Terminator : Dark fate</h2>
    </div>
  </div>
);

export default BigCard;
